import { Container, TextField, Typography, Button, Box } from '@mui/material';

export default function AddProduct() {
  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Add Products
      </Typography>
      <Box m={2}>
        <TextField label="Product Name" variant="outlined" fullWidth />
      </Box>
      <Box m={2}>
        <TextField m={5} label="Marked Price" variant="outlined" />
        <TextField label="Sale Price" variant="outlined" />
      </Box>
      <Box m={2}>
        <TextField label="Product Description" multiline cols={8} rows={6} rowsMax={4} fullWidth />
      </Box>
    </Container>
  );
}
